B.aJp=A.a(s(["Tvarsliava, panaudoti \u0161virk\u0161tai ir kitos galimai u\u017ekre\u010diamosios atliekos, susidariusios pas gyventojus buityje, turi b\u016bti saugiai \u0161alinamos kartu su mi\u0161riomis komunalin\u0117mis atliekomis. Kaip rekomenduoja sveikatos prie\u017ei\u016bros specialistai, panaudotus \u0161virk\u0161tus geriausia \u0161alinti kartu su adata, kad j\u0105 nuimant neb\u016bt\u0173 \u012fsid\u016brimo rizikos; tada sud\u0117ti \u012f sandarias talpyklas (pvz., metalinius u\u017esukamus indelius), ant talpykl\u0173 reik\u0117t\u0173 u\u017era\u0161yti ar u\u017eklijuoti, kad tai yra a\u0161tr\u016bs daiktai. Toki\u0105 paruo\u0161t\u0105 talpykl\u0105 galima d\u0117ti \u012f plastikin\u012f \u0161iuk\u0161li\u0173 mai\u0161\u0105 ir tada jau galima \u0161alinti \u012f mi\u0161ri\u0173 komunalini\u0173 atliek\u0173 konteiner\u012f."]),t.s)
